/**
 * RpcLong
 */
'use strict';
module.exports = RpcLong;

var RpcPrimitive = require('./RpcPrimitive.js');
var util = require('util');
function RpcLong(value)
{
	RpcPrimitive.call(this, "long");
	this.value = value;
}

util.inherits(RpcLong, RpcPrimitive); 

RpcLong.prototype.asJsonElement = function()
{
	return this.value;
};
